                  <FTypo className={"f-pr-1"} color="#dab46e">
                    TOKEN
                  </FTypo>
                }
              />

              <FButton title={"SWAP"} className="w-100 f-mt-2" onClick={() => {}} />
            </FItem>
          </FGridItem>
        </FGrid>
      </FCard>
    </>
  );
};

